class StateParam {
	ChangeStatus;
	X;
	Y;
	Dead;
	constructor(ChangeStatus,X,Y,Dead){
		this.ChangeStatus = ChangeStatus;
		this.X=X;
		this.Y=Y;
		this.Dead = Dead;
	}
	
}
export { StateParam }
